        // // both ongoing and upcoming
        // case 4:
        //     return(

        //     );

        default:
            return(
                <>
                <div id="boardWrapper">
                    <div id="board">
                        Something went wrong :(
                    </div>
                </div>
                </>
            );
    }
    return(
        <>
        <div id="boardWrapper">
            <div id="board">
            {props.status}
            </div>
        </div>
        
        </>
    );

}

export default Dashboard;
